import React, { useState } from "react"
import axios from "axios";


const HelloComponent = () => {
    const [hello , setHello] = useState("")

    useEffect(() => {
        axios.get('/hello')
            .then((resp) => {
                // 요청의 결과를 상태로 설정합니다.
                setHello(resp.data);
            })
            .catch((error) => {
                console.log(error);
            });
    }, []);
    
    return (
        <div>
            <h1>'${hello}'</h1>
        </div>
    );
}

export default HelloComponent;
